Page Content​​The Department is committed to protecting the rights and privacy of individuals in accordance with both European Union and Irish data protection legislation. The Department needs to lawfully & fairly process personal data about employees, customers, suppliers and other individuals in order to achieve its mission and functions. The data protection legislation confers rights on individuals as well as responsibilities on those persons processing personal data. Below are our current Data Privacy Notice and Statement: ​Data Privacy Statement - English ​Data Privacy Statement - Irish​Data Privacy Notice - English ​Data Privacy Notice - Irish Further information on how we mange Data Protection, contact our Dtata Protection Officer at dataprotection@dccae.gov.ie  






